@testset "1.3.1 Rational functions" begin
    @variables A, B, C, D, a, b, c, d, e, f, m, n, p, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*P(x)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*P3(x)^p=#


    @test_int [1/(2*sqrt(3)*b^(3/2) - 9*b*x + 9*x^3), x, 3, 1/(3*sqrt(3)*sqrt(b)*(sqrt(3)*sqrt(b) - 3*x)) - log(sqrt(b) - sqrt(3)*x)/(27*b) + log(2*sqrt(b) + sqrt(3)*x)/(27*b)]


    @test_int [(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^p, x, 3, ((a/b + x)*(b^3*(a/b + x)^3)^p)/(1 + 3*p)]

    @test_int [(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^3, x, 2, (a + b*x)^10/(10*b)]
    @test_int [(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^2, x, 2, (a + b*x)^7/(7*b)]
    @test_int [(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^1, x, 1, a^3*x + (3/2)*a^2*b*x^2 + a*b^2*x^3 + (b^3*x^4)/4]
    @test_int [1/(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^1, x, 2, -(1/(2*b*(a + b*x)^2))]
    @test_int [1/(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^2, x, 2, -(1/(5*b*(a + b*x)^5))]
    @test_int [1/(a^3 + 3*a^2*b*x + 3*a*b^2*x^2 + b^3*x^3)^3, x, 2, -(1/(8*b*(a + b*x)^8))]


    @test_int [(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^3, x, 3, -((b^3*(b^2 - 3*a*c)^3*x)/c^3) + (3*b^2*(b^2 - 3*a*c)^2*(b + c*x)^4)/(4*c^4) - (3*b*(b^2 - 3*a*c)*(b + c*x)^7)/(7*c^4) + (b + c*x)^10/(10*c^4)]
    @test_int [(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^2, x, 3, (b^2*(b^2 - 3*a*c)^2*x)/c^2 - (b*(b^2 - 3*a*c)*(b + c*x)^4)/(2*c^3) + (b + c*x)^7/(7*c^3)]
    @test_int [(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^1, x, 1, 3*a*b*x + (3*b^2*x^2)/2 + b*c*x^3 + (c^2*x^4)/4]
    @test_int [1/(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^1, x, 7, -(atan((b^(1/3) + (2*(b + c*x))/(b^2 - 3*a*c)^(1/3))/(sqrt(3)*b^(1/3)))/(sqrt(3)*b^(2/3)*(b^2 - 3*a*c)^(2/3))) + log(b - b^(1/3)*(b^2 - 3*a*c)^(1/3) + c*x)/(3*b^(2/3)*(b^2 - 3*a*c)^(2/3)) - log(b^(2/3)*(b^2 - 3*a*c)^(2/3) + b^(1/3)*c*(b^2 - 3*a*c)^(1/3)*(b/c + x) + c^2*(b/c + x)^2)/(6*b^(2/3)*(b^2 - 3*a*c)^(2/3))]
    @test_int [1/(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^2, x, 8, -((c*(b/c + x))/(3*b*(b^2 - 3*a*c)*(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3))) + (2*c*atan((b^(1/3) + (2*(b + c*x))/(b^2 - 3*a*c)^(1/3))/(sqrt(3)*b^(1/3))))/(3*sqrt(3)*b^(5/3)*(b^2 - 3*a*c)^(5/3)) - (2*c*log(b - b^(1/3)*(b^2 - 3*a*c)^(1/3) + c*x))/(9*b^(5/3)*(b^2 - 3*a*c)^(5/3)) + (c*log(b^(2/3)*(b^2 - 3*a*c)^(2/3) + b^(1/3)*c*(b^2 - 3*a*c)^(1/3)*(b/c + x) + c^2*(b/c + x)^2))/(9*b^(5/3)*(b^2 - 3*a*c)^(5/3))]
    @test_int [1/(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^3, x, 9, -((c*(b/c + x))/(6*b*(b^2 - 3*a*c)*(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)^2)) + (5*c^2*(b/c + x))/(18*b^2*(b^2 - 3*a*c)^2*(3*a*b + 3*b^2*x + 3*b*c*x^2 + c^2*x^3)) - (5*c^2*atan((b^(1/3) + (2*(b + c*x))/(b^2 - 3*a*c)^(1/3))/(sqrt(3)*b^(1/3))))/(9*sqrt(3)*b^(8/3)*(b^2 - 3*a*c)^(8/3)) + (5*c^2*log(b - b^(1/3)*(b^2 - 3*a*c)^(1/3) + c*x))/(27*b^(8/3)*(b^2 - 3*a*c)^(8/3)) - (5*c^2*log(b^(2/3)*(b^2 - 3*a*c)^(2/3) + b^(1/3)*c*(b^2 - 3*a*c)^(1/3)*(b/c + x) + c^2*(b/c + x)^2))/(54*b^(8/3)*(b^2 - 3*a*c)^(8/3))]


    @test_int [(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^3, x, 3, ((b*c - a*d)^3*(b*e - a*f)^3*(a + b*x)^4)/(4*b^7) + (3*(b*c - a*d)^2*(b*e - a*f)^2*(b*d*e + b*c*f - 2*a*d*f)*(a + b*x)^5)/(5*b^7) + ((b*c - a*d)*(b*e - a*f)*(5*a^2*d^2*f^2 - 5*a*b*d*f*(d*e + c*f) + b^2*(d^2*e^2 + 3*c*d*e*f + c^2*f^2))*(a + b*x)^6)/(2*b^7) + ((b*d*e + b*c*f - 2*a*d*f)*(10*a^2*d^2*f^2 - 10*a*b*d*f*(d*e + c*f) + b^2*(d^2*e^2 + 8*c*d*e*f + c^2*f^2))*(a + b*x)^7)/(7*b^7) + (3*d*f*(5*a^2*d^2*f^2 - 5*a*b*d*f*(d*e + c*f) + b^2*(d^2*e^2 + 3*c*d*e*f + c^2*f^2))*(a + b*x)^8)/(8*b^7) + (d^2*f^2*(b*d*e + b*c*f - 2*a*d*f)*(a + b*x)^9)/(3*b^7) + (d^3*f^3*(a + b*x)^10)/(10*b^7)]
    @test_int [(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^2, x, 3, ((b*c - a*d)^2*(b*e - a*f)^2*(a + b*x)^3)/(3*b^5) + ((b*c - a*d)*(b*e - a*f)*(b*d*e + b*c*f - 2*a*d*f)*(a + b*x)^4)/(2*b^5) + ((6*a^2*d^2*f^2 - 6*a*b*d*f*(d*e + c*f) + b^2*(d^2*e^2 + 4*c*d*e*f + c^2*f^2))*(a + b*x)^5)/(5*b^5) + (d*f*(b*d*e + b*c*f - 2*a*d*f)*(a + b*x)^6)/(3*b^5) + (d^2*f^2*(a + b*x)^7)/(7*b^5)]
    @test_int [(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^1, x, 1, a*c*e*x + (1/2)*(b*c*e + a*d*e + a*c*f)*x^2 + (1/3)*(b*d*e + b*c*f + a*d*f)*x^3 + (1/4)*b*d*f*x^4]
    @test_int [1/(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^1, x, 2, (b*log(a + b*x))/((b*c - a*d)*(b*e - a*f)) - (d*log(c + d*x))/((b*c - a*d)*(d*e - c*f)) + (f*log(e + f*x))/((b*e - a*f)*(d*e - c*f))]
    @test_int [1/(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^2, x, 2, -(b^3/((b*c - a*d)^2*(b*e - a*f)^2*(a + b*x))) - d^3/((b*c - a*d)^2*(d*e - c*f)^2*(c + d*x)) - f^3/((b*e - a*f)^2*(d*e - c*f)^2*(e + f*x)) - (2*b^3*(b*d*e + b*c*f - 2*a*d*f)*log(a + b*x))/((b*c - a*d)^3*(b*e - a*f)^3) + (2*d^3*(b*d*e - 2*b*c*f + a*d*f)*log(c + d*x))/((b*c - a*d)^3*(d*e - c*f)^3) + (2*f^3*(2*b*d*e - b*c*f - a*d*f)*log(e + f*x))/((b*e - a*f)^3*(d*e - c*f)^3)]
    @test_int [1/(a*c*e+(b*c*e+a*d*e+a*c*f)*x+(b*d*e+b*c*f+a*d*f)*x^2+b*d*f*x^3)^3, x, 2, -(b^5/(2*(b*c - a*d)^3*(b*e - a*f)^3*(a + b*x)^2)) + (3*b^5*(b*d*e + b*c*f - 2*a*d*f))/((b*c - a*d)^4*(b*e - a*f)^4*(a + b*x)) + d^5/(2*(b*c - a*d)^3*(d*e - c*f)^3*(c + d*x)^2) + (3*d^5*(b*d*e - 2*b*c*f + a*d*f))/((b*c - a*d)^4*(d*e - c*f)^4*(c + d*x)) - f^5/(2*(b*e - a*f)^3*(d*e - c*f)^3*(e + f*x)^2) - (3*f^5*(2*b*d*e - b*c*f - a*d*f))/((b*e - a*f)^4*(d*e - c*f)^4*(e + f*x)) + (3*b^5*(7*a^2*d^2*f^2 - 7*a*b*d*f*(d*e + c*f) + b^2*(2*d^2*e^2 + 3*c*d*e*f + 2*c^2*f^2))*log(a + b*x))/((b*c - a*d)^5*(b*e - a*f)^5) - (3*d^5*(2*a^2*d^2*f^2 + a*b*d*f*(3*d*e - 7*c*f) + b^2*(2*d^2*e^2 - 7*c*d*e*f + 7*c^2*f^2))*log(c + d*x))/((b*c - a*d)^5*(d*e - c*f)^5) + (3*f^5*(2*a^2*d^2*f^2 - a*b*d*f*(7*d*e - 3*c*f) + b^2*(7*d^2*e^2 - 7*c*d*e*f + 2*c^2*f^2))*log(e + f*x))/((b*e - a*f)^5*(d*e - c*f)^5)]


    @test_int [1/(1 + x + x^2 + x^3), x, 5, atan(x)/2 + (1/2)*log(1 + x) - (1/4)*log(1 + x^2)]
    @test_int [1/(-1 + 4*x - 4*x^2 + 16*x^3), x, 5, (-(1/10))*atan(2*x) + (1/5)*log(1 - 4*x) - (1/10)*log(1 + 4*x^2)]


    @test_int [1/(0 + 0*x + 0*x^2 + d*x^3), x, 2, -(1/(2*d*x^2))]
    @test_int [1/(0 + 0*x + c*x^2 + d*x^3), x, 3, -(1/(c*x)) - (d*log(x))/c^2 + (d*log(c + d*x))/c^2]
    @test_int [1/(0 + b*x + 0*x^2 + d*x^3), x, 5, log(x)/b - log(b + d*x^2)/(2*b)]
    @test_int [1/(0 + b*x + c*x^2 + d*x^3), x, 7, (c*atanh((c + 2*d*x)/sqrt(c^2 - 4*b*d)))/(b*sqrt(c^2 - 4*b*d)) + log(x)/b - log(b + c*x + d*x^2)/(2*b)]

    @test_int [1/(a + 0*x + 0*x^2 + d*x^3), x, 6, -(atan((a^(1/3) - 2*d^(1/3)*x)/(sqrt(3)*a^(1/3)))/(sqrt(3)*a^(2/3)*d^(1/3))) + log(a^(1/3) + d^(1/3)*x)/(3*a^(2/3)*d^(1/3)) - log(a^(2/3) - a^(1/3)*d^(1/3)*x + d^(2/3)*x^2)/(6*a^(2/3)*d^(1/3))]
    #= [1/(a + 0*x + c*x^2 + d*x^3), x, 3, -((72*2^(1/3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3)*log(2^(2/3)*c^2 - c*(-4*c^3 - 6*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3) + (-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3) - 3*2^(1/3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3)*x))/((2*(3*im + sqrt(3))*c^2 + 2^(1/3)*(3*im - sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3))*(2*(3*im - sqrt(3))*c^2 + 2^(1/3)*(3*im + sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3)))) - (12*2^(1/3)*sqrt(3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3)*log((2^(1/3)*c + (-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3))*(2^(1/3)*(im + sqrt(3))*c + (im - sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3)) + 6*im*2^(1/3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3)*x))/((2*c^2 - 2^(1/3)*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3))*(2*(3*im + sqrt(3))*c^2 + 2^(1/3)*(3*im - sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3))) + (12*2^(1/3)*sqrt(3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3)*log((2^(1/3)*c + (-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3))*(2^(1/3)*(im - sqrt(3))*c + (im + sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3)) + 6*im*2^(1/3)*d*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(1/3)*x))/((2*c^2 - 2^(1/3)*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3))*(2*(3*im - sqrt(3))*c^2 + 2^(1/3)*(3*im + sqrt(3))*(-2*c^3 - 3*d*(9*a*d - sqrt(3)*sqrt(a*(4*c^3 + 27*a*d^2))))^(2/3)))] =#
    #= [1/(a + b*x + 0*x^2 + d*x^3), x, 3, -((6*3^(1/6)*d^(1/3)*(3*sqrt(3)*a*d - sqrt(d*(4*b^3 + 27*a^2*d)))*log(2^(2/3)*3^(1/3)*b*d^(1/3) - (9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3) - 2^(1/3)*3^(2/3)*d^(2/3)*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(1/3)*x))/(18*3^(2/3)*a*b*d^(4/3) - 6*3^(1/6)*b*d^(1/3)*sqrt(d*(4*b^3 + 27*a^2*d)) - 6*2^(2/3)*b^2*d^(2/3)*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(1/3) - 9*6^(1/3)*a*d*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3) + 2^(1/3)*3^(5/6)*sqrt(d*(4*b^3 + 27*a^2*d))*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3))) - (12*2^(1/3)*3^(1/6)*d^(1/3)*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3)*log(2^(2/3)*3^(1/3)*(1 - im*sqrt(3))*b*d^(1/3) - (1 + im*sqrt(3))*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3) + 2*2^(1/3)*3^(2/3)*d^(2/3)*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(1/3)*x))/((6*b*d^(1/3) + 2^(1/3)*(27*a*d - 3*sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3))*(2*(3*im + sqrt(3))*b*d^(1/3) + 2^(1/3)*3^(1/6)*(1 - im*sqrt(3))*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3))) + (12*2^(1/3)*3^(2/3)*d^(1/3)*(3*sqrt(3)*a*d - sqrt(d*(4*b^3 + 27*a^2*d)))*log(2^(2/3)*3^(1/3)*(1 + im*sqrt(3))*b*d^(1/3) + im*(im + sqrt(3))*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3) + 2*2^(1/3)*3^(2/3)*d^(2/3)*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(1/3)*x))/((9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(1/3)*(6*b*d^(1/3) + 2^(1/3)*(27*a*d - 3*sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3))*(2*(3*im - sqrt(3))*b*d^(1/3) + im*2^(1/3)*3^(1/6)*(im - sqrt(3))*(9*a*d - sqrt(3)*sqrt(d*(4*b^3 + 27*a^2*d)))^(2/3)))] =#
    #= [1/(a + b*x + c*x^2 + d*x^3), x, 0, 0] =#


    @test_int [(0 + 0*x + 0*x^2 + d*x^3)^n, x, 2, (x*(d*x^3)^n)/(1 + 3*n)]
    @test_int [(0 + 0*x + c*x^2 + d*x^3)^n, x, 3, (x*(c*x^2 + d*x^3)^n*Hypergeometric2F1(-n, 1 + 2*n, 2*(1 + n), -((d*x)/c)))/((1 + (d*x)/c)^n*(1 + 2*n))]
    @test_int [(0 + b*x + 0*x^2 + d*x^3)^n, x, 3, (x*(b + d*x^2)*(b*x + d*x^3)^n*Hypergeometric2F1(1, (3*(1 + n))/2, (3 + n)/2, -((d*x^2)/b)))/(b*(1 + n)), (x*(b*x + d*x^3)^n*Hypergeometric2F1(-n, (1 + n)/2, (3 + n)/2, -((d*x^2)/b)))/((1 + d*x^2/b)^n*(1 + n))]
